import { faPhone, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faGithub } from "@fortawesome/free-brands-svg-icons";

import DisplayButton from "./DisplayButton";
import Link from "./Link";

function Contact() {
  const contacts = [
    {
      icon: faPhone,
      size: "2x",
      text: "+1 (514) 834-6110",
    },
    {
      icon: faEnvelope,
      size: "2x",
      text: "Danialrossar@gmail.com",
    },
    {
      icon: faGithub,
      size: "2x",
      height: 20,
      link: "https://github.com/danialross",
    },
  ];

  return (
    <div className="bg-lightTone">
      <div className="max-w-screen-lg mx-auto flex flex-col items-center py-padY">
        <div className="font-racing text-5xl p-10 text-darkTone">
          Get in Touch
        </div>
        <div className="flex flex-col items-center p-7 gap-10 pb-10">
          {contacts.map((item, index) => (
            <DisplayButton
              key={index}
              icon={item.icon}
              size={item.size}
              text={item.text}
            />
          ))}
        </div>
      </div>
    </div>
  );
}

export default Contact;
